"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Honeycomb cysts in IPF/UIP",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 375px; height: 283px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Idiopathic pulmonary fibrosis/usual interstitial pneumonia with bilateral, small subpleural honeycomb cysts which are separated by normal parenchyma. The anterior segmental bronchus of the left upper lobe is slightly dilated, consistent with mild traction bronchiectasis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
