"    </ul>",
"   </div>",
"   <div class=\"block iuse drugH1Div\" id=\"F4151610\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Reported Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Treatment of urinary tract infections",
"    </p>",
"   </div>",
"   <div class=\"block idos drugH1Div\" id=\"F4151612\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Range",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Oral:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Children 3 months to 12 years: 55 mg/kg/day divided every 6 hours; suppressive therapy is 30 mg/kg/day divided every 6 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Adults: 1 g 4 times/day for 2 weeks; then suppressive therapy of 500 mg 4 times/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Dosing comments in renal impairment:",
"     </b>",
"     Cl",
"     <sub>",
"      cr",
"     </sub>",
"     &lt;50 mL/minute: Avoid use",
"    </p>",
"   </div>",
"   <div class=\"block prod-avail drugH1Div\" id=\"F11821094\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Product Availability",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Product available in various countries; not currently available in the U.S.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F4151613\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justified;\">",
"     Suspension, oral: 250 mg/5 mL (473 mL) [raspberry flavor] [Not available in the U.S.]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justified;\">",
