"  </div>",
"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?25/60/26565/abstract/1\">",
"      Schneiderman LJ, Kaplan RM, Pearlman RA, Teetzel H. Do physicians' own preferences for life-sustaining treatment influence their perceptions of patients' preferences? J Clin Ethics 1993; 4:28.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?25/60/26565/abstract/2\">",
"      Burstin HR, Lipsitz SR, Brennan TA. Socioeconomic status and risk for substandard medical care. JAMA 1992; 268:2383.",
"     </a>",
