" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 520px\">",
"   <div class=\"ttl\">",
"    Complete hydatidform mole",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 500px; height: 478px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Complete hydatidiform mole. A) Complete mole in which the entire uterine cavity is filled with swollen villi. B) The villi are each 1 to 3 mm in diameter and appear grapelike. C) Individual molar villi, many of which have cavitated central cisterns, exhibit considerable trophoblastic hyperplasia and atypia. The blood vessels of the villi have atrophied and disappeared.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Rubin E MD and Farber JL MD. Pathology, 3rd Edition. Philadelphia: Lippincott Williams &amp; Wilkins, 1999. Copyright &copy; 1999 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
