"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    The Hidradenitis Suppurative Score (HSS), as modified by Sartorius, was proposed to standardize comparative analyses of treatment for HS.",
"    <div class=\"footnotes\">",
"     * Record the longest distance between two relevant lesions (eg, nodule and fistula) in each affected region, or record the size of a single lesion in each affected region.",
"    </div>",
