var title_f25_60_26573="Framing effects";
var content_f25_60_26573=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F78787&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F78787&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Framing effects: Variations in the public's attitudes toward euthanasia and physician-assisted suicide depending upon the questions asked",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Survey question",
"       </td>",
"       <td class=\"subtitle1\">",
"        Year",
"       </td>",
"       <td class=\"subtitle1\">",
"        Proportion of public supporting euthanasia or PAS, percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        When a person has a disease that cannot be cured, do you think doctors should be allowed to end the patient's life if the patient and his or her family request it?",
"        <sup>",
"         [1]",
"        </sup>",
"       </td>",
"       <td>",
"        1950",
"       </td>",
"       <td>",
"        34",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1982",
"       </td>",
"       <td>",
"        61",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1991",
"       </td>",
"       <td>",
"        63",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1998",
"       </td>",
"       <td>",
"        59",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        A patient develops metastatic cancer, which invades the bones and causes excruciating pain. Current levels of morphine, nerve blocks, and other treatments are failing to control the pain completely. In this case would it be all right, upon request from the patient, for the doctor to administer intravenous drugs, such as potassium, to intentionally end the patient's life?",
"        <sup>",
"         [2]",
"        </sup>",
"       </td>",
"       <td>",
"        1993",
"       </td>",
"       <td>",
"        65.6",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        As you may know, physician-assisted suicide involves a doctor giving a terminally ill patient the means to end his or her life. Do you think it should be legal for a doctor to help a terminally ill patient commit suicide?",
"        <sup>",
"         [3]",
"        </sup>",
"       </td>",
"       <td>",
"        1997",
"       </td>",
"       <td>",
"        45",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        If a person has a disease that will ultimately destroy their mind or body and they want to take their own life but cannot do it by themselves, should a doctor be allowed to administer lethal drugs to end the person's life?",
"        <sup>",
"         [4]",
"        </sup>",
"       </td>",
"       <td>",
"        1998",
"       </td>",
"       <td>",
"        47",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Sometimes, terminally ill patients want to die and ask a doctor to help them commit suicide. Should it be legal for doctors to give a lethal dose of drugs to terminally ill patients who ask for it?",
"        <sup>",
"         [5]",
"        </sup>",
"       </td>",
"       <td>",
"        1999",
"       </td>",
"       <td>",
"        54",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        In 1997, the US Supreme Court ruled that individuals do not have a constitutional right to doctor-assisted suicide. Do you agree or disagree with this decision?",
"        <sup>",
"         [6]",
"        </sup>",
"       </td>",
"       <td>",
"        2005",
"       </td>",
"       <td>",
"        35",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Regardless of whether or not you think it should be legal, please tell me whether you personally believe that in general it is morally acceptable or morally wrong. How about doctor assisted suicide?",
"        <sup>",
"         [7]",
"        </sup>",
"       </td>",
"       <td>",
"        2005",
"       </td>",
"       <td>",
"        49",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        All in all, do you strongly favor, favor, oppose, or strongly oppose making it legal for doctors to assist terminally ill patients in committing suicide?",
"        <sup>",
"         [8]",
"        </sup>",
"       </td>",
"       <td>",
"        2005",
"       </td>",
"       <td>",
"        44",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Is doctor-assisted suicide morally acceptable?",
"        <sup>",
"         [9]",
"        </sup>",
"       </td>",
"       <td>",
"        2007",
"       </td>",
"       <td>",
"        49",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        When a person has a disease that cannot be cured and is living in severe pain, do you think doctors should or should not be allowed by law to assist the patient to commit suicide if the patient requests it?",
"        <sup>",
"         [9]",
"        </sup>",
"       </td>",
"       <td>",
"        2007",
"       </td>",
"       <td>",
"        56",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        When a person has a disease that cannot be cured and is living in severe pain, do you think doctors should or should not be allowed by law to end the patient's life by some painless means if the patient and his family request it?",
"        <sup>",
"         [9]",
"        </sup>",
"       </td>",
"       <td>",
"        2007",
"       </td>",
"       <td>",
"        71",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Blendon, RJ, Szalay, US, Knox, RA, JAMA 1992; 267:2658. Gallup Poll June 1998.",
"       </li>",
"       <li>",
"        Emanuel, EJ, Fairclough, DL, Daniels, ER, Clarridge, BR, Lancet 1996; 347:1805.",
"       </li>",
"       <li>",
"        CBS News Poll, November 23-24, 1998.",
"       </li>",
"       <li>",
"        Rasmussen Research, March 30, 1999.",
"       </li>",
"       <li>",
"        Princeton Survey Research Associated for Kaiser Family Foundation and Harvard University, November 5, 1997.",
"       </li>",
"       <li>",
"        Harris Interactive Poll, April 2005; Roper Center, Storrs, CT.",
"       </li>",
"       <li>",
"        Gallup Poll, May 2005; Roper Center, Storrs, CT.",
"       </li>",
"       <li>",
"        Pew Research Center, Pew Forum on Religion and Public Life; Roper Center, Storrs, CT.",
"       </li>",
"       <li>",
"        <a href=\"file://www.gallup.com/poll/27727/public-divided-over-moral-acceptability-doctorassisted-suicide.aspx\" target=\"_blank\">",
"         file://www.gallup.com/poll/27727/public-divided-over-moral-acceptability-doctorassisted-suicide.aspx",
"        </a>",
"        .",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
